import styled from "styled-components"


export const Header = styled.div`
    height: 64px;
    align-items: center;
    justify-content: center;
    display: flex;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
`;

export const Container = styled.div`
    position: absolute;
    width: 375px;
    height: 436px;
    left: 0px;
    top: 0px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
`;

export const HeaderButtonLeft = styled.button`
    margin-left: 10px;
    left: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;

export const Container1 = styled.div`
    position: absolute;
    width: 375px;
    height: 967px;
    left: 0px;
    top: 346px;
    background: #FFFFFF;
    border-radius: 40px;
`;

export const Text1 = styled.text`
    position: absolute;
    width: 156px;
    height: 24px;
    left: 30px;
    top: 386px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 700;
    font-size: 16px;
    line-height: 24px;
    color: #1D1617;
`;

export const Text2 = styled.text`
    position: absolute;
    width: 89px;
    height: 18px;
    left: 30px;
    top: 415px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;

export const Text3 = styled.text`
    position: absolute;
    width: 71px;
    height: 24px;
    left: 30px;
    top: 463px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 600;
    font-size: 16px;
    line-height: 24px;
    color: #1D1617;
`;

export const Container2 = styled.div`
    position: absolute;
    width: 81px;
    height: 38px;
    left: 30px;
    top: 502px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    opacity: 0.2;
    border-radius: 12px;
`;

export const Container3 = styled.div``;
export const Container4 = styled.div``;
export const Container5 = styled.div``;
